//https://leetcode.com/problems/minimum-moves-to-equal-array-elements
class Solution {
public:
    int minMoves(vector<int>& nums) {
        int count = 0;
        int min_val = INT_MAX;
        for(auto a: nums){
            min_val = min(a, min_val);
        }
        for(auto a: nums){
            count += a - min_val;
        }
        return count;
    }
};
